import React from 'react';

function Project({ project }) {
    return (
        <div className="project">
            <h2>{project.title}</h2>
            <p>{project.description}</p>
            <img src={project.image} alt={project.title} />
            <a href={project.link}>View Project</a>
        </div>
    );
}

export default Project;
